import React, { useState } from 'react';
import NavCss from '../CSS/Navbar.css';
import { CiMenuBurger } from "react-icons/ci";
import { RxCross2 } from "react-icons/rx";

const Navbar = () => {
  const [sidebarVisible, setSidebarVisible] = useState(false);

  const toggleSidebar = () => {
    setSidebarVisible(!sidebarVisible);
  };

  return (
    <div className='nav_containr'>
      <nav>
        {/* Sidebar */}
        <ul className={`sidebar ${sidebarVisible ? 'visible' : ''}`}>
          <li onClick={toggleSidebar}><a href="#"><RxCross2 /></a></li>
          <li><a href="#">HOME</a></li>
          <li><a href="#">SERVICES</a></li>
          <li><a href="#">ABOUT US</a></li>
          <li><a href="#">CONTACT US</a></li>
          <li><a href="#">CAREERS</a></li>
        </ul>

        {/* Navbar */}
        <ul className="main-menu">
          <li><img src="White Logo.png" alt="" /></li>
          <li><a href="#">SERVICES</a></li>
          <li><a href="#">ABOUT US</a></li>
          <li><a href="#">CONTACT US</a></li>
          <li><a href="#">CAREERS</a></li>
          <li onClick={toggleSidebar}><a href="#"><CiMenuBurger /></a></li>
        </ul>

        {/* RxCross2 component in the same level as "HOME" */}
        <RxCross2 onClick={toggleSidebar} />
        <li><a href="#">HOME</a></li>
      </nav>
    </div>
  );
};

export default Navbar;
